import React from "react";
import { ItemsOfList } from "./ItemsOfList";

export const Sidebar = () => {
  return (
    <section className="sidebar_section">
      <div className="mini_sidebar bg-dark vh-100">
        <ul className="p-0">
          <ItemsOfList item='داشبورد' icon='fas fa-tachometer-alt'/>
          
          <ItemsOfList item='مدیریت گروه محصولات' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریت محصول' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریت برندها' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریت گارانتی ها' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریت رنگ ها' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریت تخفیف ها' icon='fas fa-tachometer-alt'/>
          
          <ItemsOfList item='مدیریت سبدها' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='مدیریرت س' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='داشبورد' icon='fas fa-tachometer-alt'/>
          <ItemsOfList item='داشبورد' icon='fas fa-tachometer-alt'/>
        </ul>
      </div>
    </section>
  );
};
